style.css:
/* Cambia todos los fondos blancos a negro */
body, div, section, article, header, footer, aside, main, nav, p, h1, h2, h3, h4, h5, h6, span, a, input, textarea, button {
    background-color: black !important;
}

/* Mantén el color del texto intacto */
body, div, section, article, header, footer, aside, main, nav, p, h1, h2, h3, h4, h5, h6, span, a, input, textarea, button {
    color: inherit;
}

/* Asegúrate de que los enlaces sigan siendo legibles */
a {
    color: inherit;
}

/* Si hay elementos con un fondo blanco específico, cámbialos también */
* {
    background-color: black !important;
}

/* Asegúrate de que el texto no se cambie accidentalmente a negro */
* {
    color: inherit !important;
}
